    return (
        <>
        <section>
            <div className="container-fluid">
                 <div className="view-pic">
                 {
                    id == '1' ?  (<img src='\assets\photogp.jpeg' className='img-fluid'/>) : 
                    (<img src='\assets\photogp.jpeg' className='img-fluid'/>)
                }
                 </div>
            </div>
        </section>




        </>
    )
}

export default View
